    "2016-05-08T00:32:28.117874",nt"name": "chemicals-in-cosmetics-780f2",nt"isopen":
    true,nt"url": null,nt"notes": "<p>This data is from the California Safe
    Cosmetics Program (CSCP) in the California Department of Public Health. The primary
    purpose of the CSCP is to collect information on hazardous and potentially hazardous
    ingredients in cosmetic products sold in California and to make this information
    available to the public. For all cosmetic products sold in California, the California
    Safe Cosmetics Act requires the manufacturer, packer, and/or distributor named on
    the product label to provide to the CSCP a list of all cosmetic products that contain
    any ingredients known or suspected to cause cancer, birth defects, or other developmental
    or reproductive harm. The CSCP maintains a list of u201creportableu201d ingredients.
    Companies with reportable ingredients in their products must submit information
    to the California Safe Cosmetics Program if the company: u2022Has annual aggregate
    sales of cosmetic products of one million dollars or more, and u2022Has sold cosmetic
    products in California on or after January 1, 2007. The data table consists of:
    label names of cosmetic/personal care products, company/manufacturer names, product
    brand names, product categories, Chemical Abstracts Service registry numbers (CAS#)
    of the reported chemical ingredients, names of reported chemical ingredients, the
    number of reported chemicals for each product, and dates of reporting, product discontinuation
    or reformulation if applicable. The data reflect information that has been reported
    to the CSCP. All products containing carcinogens or developmental or reproductive
    toxicants may not be included, due to companies failing to report.</p>n",nt"license_title":
